// https://github.com/trendmicro-frontend/react-sidenav
import SideNav, {
  // Toggle,
  // Nav,
  NavItem,
  NavIcon,
  NavText,
} from "@trendmicro/react-sidenav";
import "@trendmicro/react-sidenav/dist/react-sidenav.css";
import "../SideBar.css";

export default function SideBarComponent() {
  return (
    <div>
      <SideNav
        className="SideBar"
        onSelect={(selected) => {
          // function(eventKey, event)
          // Callback fired when a navigation item is selected
          // Add your code here
        }}
      >
        <SideNav.Toggle />
        <SideNav.Nav defaultSelected="home">
          <NavItem eventKey="home" navitemClassName="ni">
            <NavIcon>
              <i className="bi bi-house-door-fill"></i>
            </NavIcon>
            <NavText>Home</NavText>
          </NavItem>
          <NavItem eventKey="countries">
            <NavIcon>
              <i className="bi bi-globe"></i>
            </NavIcon>
            <NavText>Countries</NavText>
          </NavItem>
          <NavItem eventKey="genres">
            <NavIcon>
              <i className="bi bi-music-note-list"></i>
            </NavIcon>
            <NavText>Genres</NavText>
          </NavItem>
          <NavItem eventKey="favorites">
            <NavIcon>
              <i className="bi bi-star"></i>
            </NavIcon>
            <NavText>Favorites</NavText>
          </NavItem>
          <NavItem eventKey="add">
            <NavIcon>
              <i className="bi bi-plus-circle-fill"></i>
            </NavIcon>
            <NavText>Add music</NavText>
          </NavItem>
        </SideNav.Nav>
      </SideNav>
    </div>
  );
}
